export default function Nav() {
  const [active, setActive] = useState("Dashboard");
  const [collapsed, setCollapsed] = useState(false);

  return (
    <div className="flex h-screen bg-gray-100 overflow-hidden">
      {/* Sidebar */}
      <aside
        className={`bg-gray-800 text-white flex flex-col p-4 relative transition-all duration-500 ease-in-out ${
          collapsed ? "w-20" : "w-64"
        }`}
      >
        {/* Toggle Button */}
        <button
          className="absolute mt-7 top-10 -right-3 p-1 bg-red-600 text-white rounded-full hover:bg-red-700 transition duration-300 ease-in-out shadow-lg"
          onClick={() => setCollapsed(!collapsed)}
        >
          {collapsed ? (
            <ChevronRightIcon className="w-5 h-5" />
          ) : (
            <ChevronLeftIcon className="w-5 h-5" />
          )}
        </button>

        {/* Logo */}
        <div className="flex items-center justify-center mb-10 mt-8">
          <img
            src="/images/tupseal.png"
            alt="Tupseal"
            className={`transition-all duration-500 ease-in-out ${
              collapsed ? "w-12 h-12" : "w-32 h-32"
            }`}
          />
        </div>

        {/* Navigation */}
        <nav className="flex flex-col space-y-2">
          {[
            { name: "Dashboard", icon: HomeIcon, path: "/dashboard" },
            { name: "Usage Monitor", icon: ChartBarIcon, path: "/usage-monitor" },
            { name: "Janitors", icon: UsersIcon, path: "/janitors" },
            { name: "Resources", icon: CogIcon, path: "/resources" },
            { name: "Settings", icon: CogIcon, path: "/settings" },
            { name: "Users", icon: UsersIcon, path: "/users" },
          ].map((item) => (
            <Link
              to={item.path}
              key={item.name}
              className={`flex items-center p-3 rounded-lg transition-all duration-300 ease-in-out group ${
                active === item.name
                  ? "bg-gray-700 text-white"
                  : "hover:bg-gray-600"
              }`}
              onClick={() => setActive(item.name)}
            >
              {/* Icon */}
              <div className="w-6 h-6 flex justify-center items-center transition-transform duration-300 group-hover:scale-110">
                <item.icon className="w-6 h-6" />
              </div>

              {/* Text */}
              {!collapsed && (
                <span className="ml-3 transition-all duration-300 group-hover:translate-x-1">
                  {item.name}
                </span>
              )}
            </Link>
          ))}
        </nav>

        {/* Logout */}
        <button className="mt-auto flex items-center p-3 rounded-lg hover:bg-red-700 transition-all duration-300 ease-in-out">
          <LogoutIcon className="w-6 h-6 transition-transform duration-300 hover:scale-110" />
          {!collapsed && <span className="ml-3">Log Out</span>}
        </button>
      </aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Navbar */}
        <header className="bg-white shadow-md p-6 flex justify-between items-center transition-shadow duration-300 ease-in-out">
          <h1 className="text-lg font-semibold"></h1>
          <div className="flex items-center space-x-4">
            <BellIcon className="w-6 h-6 text-gray-600 cursor-pointer hover:text-gray-800 transition-colors duration-300" />
            <div className="flex items-center">
              <img
                className="w-8 h-8 rounded-full border transition-transform duration-300 hover:scale-110"
                src=""
                alt="User"
              />
              <span className="ml-2 mr-4 font-medium">@juandelacruz</span>
            </div>
          </div>
        </header>

        {/* Main Content Area */}
        <main className="p-6 bg-gray-100 flex-1">
          <p>Dashboard content goes here...</p>
        </main>
      </div>
    </div>
  );
}
